/* eslint-disable no-unused-vars */
/**
=========================================================
* Argon Dashboard 2 MUI - v3.0.0
=========================================================

* Product Page: https://www.creative-tim.com/product/argon-dashboard-material-ui
* Copyright 2022 Creative Tim (https://www.creative-tim.com)

Coded by www.creative-tim.com

 =========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.
*/

// @mui material components
import Grid from "@mui/material/Grid";
import Icon from "@mui/material/Icon";
import Card from "@mui/material/Card";


// Argon Dashboard 2 MUI components
import ArgonBox from "components/ArgonBox";
import ArgonTypography from "components/ArgonTypography";

// Argon Dashboard 2 MUI example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import DetailedStatisticsCard from "examples/Cards/StatisticsCards/DetailedStatisticsCard";
import SalesTable from "examples/Tables/SalesTable";
import CategoriesList from "examples/Lists/CategoriesList";
import GradientLineChart from "examples/Charts/LineCharts/GradientLineChart";


import React, { useState, useEffect } from "react";
import { Redirect, Route } from "react-router-dom";
// Argon Dashboard 2 MUI base styles
import typography from "assets/theme/base/typography";

// Dashboard layout components
import Slider from "layouts/dashboard/components/Slider";
import {
  onSnapshot,
  collection,
  getDocs,
  addDoc,
  updateDoc,
  deleteDoc,
  doc
} from "firebase/firestore";
import Projresults from "./projectsslide";
import Tasks from "./task";
import "./dash.css";

import { db } from "../../firebase.js";

// Data
import gradientLineChartData from "layouts/dashboard/data/gradientLineChartData";
import salesTableData from "layouts/dashboard/data/salesTableData";
import categoriesListData from "layouts/dashboard/data/categoriesListData";

function Default() {
  const { size } = typography;

  const [tasks, settasks] = useState([]);

 useEffect(
   () =>
     onSnapshot(collection(db, "tasks"), (snapshot) =>
       settasks(snapshot.docs.map((doc) => ({ ...doc.data(), id: doc.id })))
     ),
   []
 );

  const [newTodo, setNewTodo] = useState([]);
  const [projects, setProject] = useState([]);

  useEffect(
    () =>
      onSnapshot(collection(db, "projects"), (snapshot) =>
        setProject(snapshot.docs.map((doc) => ({ ...doc.data(), id: doc.id })))
      ),
    []
  );
  return (
    <DashboardLayout>
      <DashboardNavbar />
      <ArgonBox py={3}>

 <grid container spacing={3} mb={3} classename="">
        <div classename="cardproj">
                    {projects.map((projects: any) => (
                      <div key={projects.id}>
                        <Projresults
                          id={projects.id}
                          projtitle={projects.projtitle}
                          des={projects.des}
                          color={projects.color}

                        />
                      </div>
                    ))}

      </div>
  </grid>

        <Grid style={{margin: "15px"}}container spacing={3} mb={3}>
        <ArgonBox mb={3}>
          <Card>
            <ArgonBox display="flex" justifyContent="space-between" alignItems="center" p={3}>
              <ArgonTypography variant="h6">My Notes</ArgonTypography>
            </ArgonBox>
            <ArgonBox
              sx={{
                "& .MuiTableRow-root:not(:last-child)": {
                  "& td": {
                    borderBottom: ({ borders: { borderWidth, borderColor } }) =>
                      `${borderWidth[1]} solid ${borderColor}`,
                  },
                },
              }}
            >
            <div>
                        {projects.map((projects: any) => (
                          <SwiperSlide key={projects.id}>
                            <Projresults
                              id={projects.id}
                              projtitle={projects.projtitle}
                              des={projects.des}
                              color={projects.color}
                              onDelete={projdeleteChangeHandler}
                            />
                          </SwiperSlide>
                        ))}
                      </div>
            </ArgonBox>
          </Card>
        </ArgonBox>

        </Grid>
        <Grid container spacing={3}>
          <Grid item xs={12} md={8}>
            <SalesTable title="Sales by Country" rows={salesTableData} />
          </Grid>
          <Grid item xs={12} md={4}>
            <CategoriesList title="projects" categories={categoriesListData} />
          </Grid>
        </Grid>
      </ArgonBox>
      <Footer />
    </DashboardLayout>
  );
}

export default Default;
